body:
We, the SDOG token holders voting yes, have self organized and propose to form a new SDOG DAO (“Decentralized Autonomous Organization”). The new SDOG DAO will take on the work of promoting and bringing value to the SDOG ecosystem.

This new DAO will be called the Snowdog DAO, abbreviated herein as the new SDOG DAO.

The SDOG DAO understands that SnowBank DAO formerly controlled and subsequently abandoned the original SDOG DAO. The assets of the original SDOG DAO were placed in wallets controlled by SnowBank DAO for safekeeping after the events of November 25, 2021 (a detailed account of which is beyond the scope of this proposal). These assets include SDOG tokens and SDOG-MIM LP (“Liquidity Provider”) positions in addition to other unidentified and unreported assets raised through the original SDOG DAO website (that were not spent or exploited in the events of November 25, 2021).

The new SDOG DAO requests that SnowBank DAO transfer ALL financial interests, relationships and token assets raised, controlled, and otherwise owned by the original SDOG DAO at the time of SnowBanks’ abandonment of the original SDOG DAO, that it is currently holding for safekeeping to the following multi-signature address owned by new SDOG DAO:

0xcFa8196852Cc36A8f46B7DDe957a11aD5149542f

The new SDOG DAO will use a 3 of 5 multi-signature wallet with the following signers:
@andy378 - 0x1C531C5743982Cd555DdF167a38BB12C65fB3dB1
@zap - 0x8CAb624F571deFd20095f67752a25fB82a507B8C
@qubit - 0x0F60f3dFa07d07483733294B6B2FE7490D1Ee116
@wubs - 0xf31a738198CF6a61A678C12948847671C9E429Af
@elon musk - 0x567B7A223ef9fb356f4324b6c7AAabbe641F00aE

The signers of the multi-signature contract take on the fiduciary responsibility to safeguard these assets and only use them at the direction of future votes by the community, whatever it may decide. Additionally, if the signers of the multi-signature wallet unanimously agree, they may spend minimal treasury assets on reasonable and necessary expenses to facilitate this transition and the establishment of the new SDOG DAO and the safeguarding of its assets. A public announcement will be made in the public and official Discord server of the new SDOG DAO of any transactions along with their justification at least 24 hours prior to their execution.

The undersigned SDOG token holders voting yes endorse this plan and request SnowBank DAO and the original SDOG DAO transfer all token, assets, and funds held on behalf of the original SDOG DAO to the above multi-signature address for the future benefit of the SDOG DAO token holders.

The new SDOG DAO requests that those in control of the original SDOG DAO assets transfer control of any social media assets, domain names, intellectual property, or other non blockchain assets upon receipt of instructions that will be delivered in a message cryptographically signed by the signers of the enclosed multi-signature address. The new SDOG DAO requests that SnowBank DAO commit to an orderly transition of these assets.

This proposal is limited in scope to establishing the new SDOG DAO, the multisig contract and its signers, and to request the treasury and other assets be transferred to the new SDOG DAO, and the payment of minimal expenses upon unanimous vote of the signers. Matters relating to new names, uses of treasury, or other future plans will be subject to future debate and voting by the SDOG DAO token holders.
